#!/usr/bin/env python3

#Problem 4
dna = ''

nt_count = {}

dna_set = set(dna)
print('These are the unique characters:',dna_set)

for nt in dna_set:
  count = dna.count(nt)
  nt_count[nt] = count #where nt is the key, so like 'A', and count is the number of times its in dna
print('This is the dictionary:', nt_count)

for i in nt_count:
  print(i) #this returns the key

G_int = (int(nt_count['G']))
C_int = (int(nt_count['C']))
len_of_dna = len(dna)

GC_content = (G_int + C_int) / len_of_dna
print(GC_content)
